      <ul>
        <li>  <Link to='/'>Search</Link> </li>
        <li>  <Link to='/collections/'>Collection</Link> </li>
      </ul>
      <Routes>
      <Route path='/' exact component={Search} />
      <Route path='/collections' element={<Collections/>}/>
      </Routes>
    </Router>
    )
  }

export default App
